import './App.css';
import React, { useState } from 'react';
import AnalogueClock from 'react-analogue-clock';
import { Grid, Row, Col } from 'react-bootstrap';

function App() {
    const [view_tick, set_tick] = useState(0);
    const clockOptions = {
        baseColor: '#ffffff',
        borderColor: '#000000',
        borderWidth: 2,
        centerColor: '#000000',
        handColors: {
            hour: '#000000',
            minute: '#000000',
            second: '#000000',
        },
        notchColor: '#000000',
        numbersColor: '#000000',
        showNumbers: true,
        size: 200
    }
    return (
        <>
            <header id="header">
                <a href="#">Home</a>
                <a href="#">Policy</a>
                <a href="#">Content</a>
            </header>
            <div id="main">
                <Grid style={{alignContent:"center"}}>
                    <Row>
                        <Col>
                            <div id="sdata-stream">
                                <center>
                                    <code>
                                        <b>
                                            {tick(set_tick)}
                                            {view_tick}
                                        </b>
                                    </code>
                                </center>
                            </div>
                        </Col>
                    </Row>
                    <Row>
                        <Col xs="2">
                            <div id="aanalog-stream">
                                < AnalogueClock {...clockOptions} />
                            </div>
                        </Col>
                    </Row>
                </Grid>
            </div>
            <footer id="footer">
                <div id="footer-id">
                    <br /><br />powered by <a href="#" id="footer-id-a">todolib.in</a><br /><br /><br />
                    <p>Â© 2021 Todo Lib's & Gti<br /><br />
                    Contact Us Privacy Policy</p>
                </div>
            </footer>
        </>
    );
}

function tick(set_tick) {
    setTimeout(() => {
        set_tick(Date());
    }, 1000)
}

export default App;
